import React from 'react';

import Button from '../../UI/Button/Button';
import Phone from './Phone/Phone';
import styles from './NavContacts.module.css';

function navContacts() {
  return (
    <div className={styles.contacts}>
      <p>Company Name</p>
      <Phone />

      <p>
        <svg version="1" xmlns="http://www.w3.org/2000/svg" width="14" height="14" viewBox="0 0 578 578"><path d="M255,0C114.75,0,0,114.75,0,255s114.75,255,255,255s255-114.75,255-255S395.25,0,255,0z M255,459c-112.2,0-204-91.8-204-204S142.8,51,255,51s204,91.8,204,204S367.2,459,255,459z"/><path d="M267.75 127.5L229.5 127.5 229.5 280.5 362.1 362.1 382.5 328.95 267.75 260.1z"/></svg>
        Mon - Fri: 9 - 5, Sat 9 - 2
      </p>

      <Button type='button'>Заказать Звонок</Button>
    </div>
  )
}

export default navContacts
